import Layout from "../../components/layout";
import dynamic from "next/dynamic";

const DynamicComponentWithNoSSR = dynamic(
  () => import("../../components/MapComp"),
  { ssr: false }
);

function MapComp() {
  return (
    <Layout>
      <DynamicComponentWithNoSSR />
    </Layout>
  );
}

export default MapComp;
